import Home from "./page/home"
import Contact from "./page/contact"
import './App.css';
import {BrowserRouter, Route,Redirect, Switch} from "react-router-dom"
function App() {
  return (
    <div className="App">
    <BrowserRouter>
    <Switch>
    <Route exact path="/">
    <Home/>
    </Route>

    <Route  exact path="/contact">
<Contact/>
    </Route>

    </Switch>
    </BrowserRouter>
    </div>
  );
}

export default App;
